import React from 'react';



let state = {
    profilePage:{
        PostsData:[
            {id:1, messange:"hi", like:12},
            {id:2, messange:"hi", like:23}
        ]
    },
    messangesPage: {
        MessageData:[
            {id:1, messange:"hi"},
            {id:2, messange:"hi"},
            {id:3, messange:"hi"},
            {id:4, messange:"hi"},
            {id:5, messange:"hi"}
        ]
    }

}

export default state;
